import "./App.css";
import { BrowserRouter as Router,Switch, Routes } from "react-router-dom";
// import Navbar from "./components/Navbar";
import Home from "./components/home";
import About from "./components/about";
function App() {
  return (
    <>
      <Router>
        {/* <Navbar /> */}

        <Routes exact path="/">
          <Home />
        </Routes>

        <Routes exact path="/about">
          <About />
        </Routes>
      </Router>
    </>
  );
}

export default App;
